    [],nt"revision_timestamp": "2016-02-12T13:46:04.947120",nt"name": "declass-1-1996-corona-lanyard-argon-missions-kh1-thru-kh6-1960-1972",nt"isopen":
    false,nt"url": null,nt"notes": "On February 24, 1995, President Clinton
    signed an Executive Order, directing the declassification of intelligence imagery
    acquired by the first generation of United States photo-reconnaissance satellites,
    including the systems code-named CORONA, ARGON, and LANYARD. More than 860,000 images
    of Earth's surface, collected between 1960 and 1972, were declassified with the
    issuance of this Executive Order. The National Archives and Records Administration
    (NARA) was given the responsibility for the original film and provide access to
    a duplicate copy for public viewing of the film. The USGS was also provided a dupe
    copy to support science products. Both NARA and the USGS provide access and product
    support for Declass-1 collection. Online requests for these data can be placed via
    the EarthExplorer interactive query system. EarthExplorer contains metadata and
    online samples of Earth science data. With EarthExplorer, you may review metadata,
    determine product availability, and place online requests for products. More than
    40 percent of the imagery contains significant cloud cover. The use of browse imagery
    gives the user the opportunity to review a reduced spatial resolution image to determine
    whether or not the area of interest is covered and is or is not obscured by clouds.",nt"license_title":
